  repeat => [
    [qr/(All Dates
+)(?:[^
]+[^}]
)*([^
]+\})
(?:[^
]+
)*?$month $day, $year, $time_ap
.*?

/s => {
      fields => [qw(save summary month day year start_time)],
      follow_link => {
        once => [
          [qr/Ticket Prices[^
]+
+.*?(?:(?:
|[^
]+\}
))+(?:[^
]+\}
)+
(.*?)
{3}/si => {
            fields => [qw(description)],
          }],
        ],
      },
    }],
